import React from 'react';
import CardSingle from './CardSingle';


function AllPropertiesCardTemplate(props) {
    return (
        <div>
            <CardSingle
                  {...props.card1template}
                />
                <CardSingle
                  {...props.card2template}
                />
                <CardSingle
                  {...props.card3template}
                />
                <CardSingle
                  {...props.card4template}
                />
                <CardSingle
                  {...props.card5template}
                />
            <CardSingle
                  {...props.card6template}
                />
                <CardSingle
                  {...props.card7template}
                />
                <CardSingle
                  {...props.card8template}
                />
                <CardSingle
                  {...props.card9template}
                />
                <CardSingle
                  {...props.card10template}
                />
        </div>
    )
}

export default AllPropertiesCardTemplate
